import React, { Component } from 'react'
import { connect } from 'react-redux'

class VideoPage extends Component {
  render() {
    return (
      <div>index
        <video src={this.props.video.url} controls autoplay></video>
      </div>

    )
  }
}

export default connect(
  state => ({video:state.video}),
  {}
)(VideoPage)
